using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class ShellInputModel : Notifier	{		public ShellInputModel()		{					CAOfShell = "";			CourseCount = "";			PlateCnt = "";		}				private string _CAOfShell;		public string CAOfShell			{				get { return _CAOfShell; }				set				{					_CAOfShell = value;					OnPropertyChanged(nameof(CAOfShell));				}			}				private string _CourseCount;		public string CourseCount			{				get { return _CourseCount; }				set				{					_CourseCount = value;					OnPropertyChanged(nameof(CourseCount));				}			}				private string _PlateCnt;		public string PlateCnt			{				get { return _PlateCnt; }				set				{					_PlateCnt = value;					OnPropertyChanged(nameof(PlateCnt));				}			}			}}